package prasad.leetcode.p567;

import org.junit.Assert;
import org.junit.Test;

public class PermutationInStringTest {

    @Test
    public void test01() {
        Assert.assertTrue(new PermutationInString().checkInclusion("ab", "eidbaooo"));
    }

    @Test
    public void test02() {
        Assert.assertFalse(new PermutationInString().checkInclusion("ab", "eidboaoo"));
    }

    @Test
    public void test03() {
        Assert.assertFalse(new PermutationInString().checkInclusion("abcdef", "abc"));
    }

    @Test
    public void testTime() {
        long start = System.currentTimeMillis();
        new PermutationInString().checkInclusion("",
                "");
        System.out.println("Time = " + (System.currentTimeMillis() - start) + " ms");
    }
}
